import { Box } from "@mui/material";
import React from "react";
import Map from '../../images/assets/map.png';
import Item from "../Item";
import Carousel from 'react-elastic-carousel'

const data = [
    { id: 1, name: '12Mn' },
    { id: 2, name: '7.5Mn' },
    { id: 3, name: '5Mn' },
    { id: 4, name: '11.2Mn' },
    { id: 5, name: '7.5Mn' },
    { id: 6, name: '5Mn' },
    { id: 7, name: '11.2Mn' },
]

export default function AboutTeamCarousel() {

    return (
        <Box sx={{ minHeight: '60vh', marginTop: '90px' }}>
            <div className="team-container">
                <img src={Map} alt="Map" width={1137} height={477} />
                <Carousel
                    enableAutoPlay={false}
                    showArrows={true}
                    enableMouseSwipe={true}
                    pagination={true}
                    itemsToShow={3}
                >
                    {data.map((item, index) => {
                        return (
                            <Item key={index} className='company-image'>
                                <div style={{ display: 'grid', textAlign: 'center' }}>

                                    <span style={{ fontSize: '16px', color: 'black', fontWeight: '600' }}>{item.name}</span>
                                </div>
                            </Item>
                        )
                    })}


                </Carousel>
            </div>
        </Box>
    )
}
